import React, { Component } from "react";
import logo from "../images/LinkedRoadLogo.jpg";
import "./NavMenu.css";

class NavMenu extends Component {
  render() {
    return (
      <nav>
        <div className="logo">
          <img src={logo} alt="LinkedRoad Logo" />
        </div>
        <div className="menu">
          <ul>
            <li><a href="#">Home</a></li>
            <li><a href="#">About</a></li>
            <li><a href="#">Services</a></li>
            <li><a href="#">Contact</a></li>
            <li><a href="#">Register</a></li>
          </ul>
        </div>
      </nav>
    );
  }
}

export default NavMenu;
